function registrarPago(){$.post("/RRHH/RegistrarPago",{Socios:getData(),IdIteracion:$("#idIteracion").val()}).done(function(n){n.isEverythingGood==!0&&CargarMenu()}).always(function(){CargarAlertas(frmHome)})}function getData(){var n=[];return $("input[type=checkbox]:checked").each(function(t,i){var r=i.id;n.push(r)}),n}function generarTxt(n){var t=getSociosTxt(n);t.length>0?$.post("/RRHH/GenerarTxt",{Socios:t,TipoBanco:n,IdIteracion:$("#idIteracion").val()}).done(function(n){n.isEverythingGood==!0&&(window.location="/Base/ExportarFileCompleto?token="+n.token)}).always(function(){CargarAlertas(frmHome)}):Danger("El txt no puede generarse porque los socios seleccionados no corresponden al tipo de banco seleccionado.")}function getSociosTxt(n){var t=[];return $("input[data-tipobanco="+n+"]:checked").each(function(n,i){var r=i.id;t.push(r)}),t}